import React,{Component} from 'react';
import {Line, Bar} from 'react-chartjs-2';

class Chart extends Component{
    constructor(){
        super(props);
        this.state = {
            chartData:{
                labels: ["Boston","Wrcester","Springfield","Ottawa","Toronto"],
                datasets:[
                   {
                       label: 'Population',
                       data:[
                        10000,
                        11000,
                        12000,
                        13000,
                        14000,
                        15000
                       ],
                       backgroundColor: "green"
                   }
                ]
            }
        }
    }


    render(){
        return(
            <div className = "chart">
                <Bar
                    data = {this.state.data}
                    options={{
                        maintainAspectRatio: false
                    }}
                />
            </div>
        )
    }
}

export default Chart;
